import React from 'react';

function Menu() {
    const handleMyMenuClick = () => {
        console.log("My menu clicked");
    };

    const handleAddRecipeClick = () => {
        console.log("Add recipe clicked");
    };

    const handleScheduleClick = () => {
        console.log("Schedule clicked");
    };

    const handlePlanClick = () => {
        console.log("Plan clicked");
    };

    return (
        <div className="menu">
            <button onClick={handleMyMenuClick}>My Menu</button>
            <button onClick={handleAddRecipeClick}>Add Recipe</button>
            <button onClick={handleScheduleClick}>Schedule</button>
            <button onClick={handlePlanClick}>Plan</button>
        </div>
    );
}

export default Menu;
